import React from "react";
import OverviewSection from "./OverviewSection/OverviewSection";
import HeaderSection from "./HeaderSection/HeaderSection";
import ProfileSection from "./ProfileSection/ProfileSection";

function App() {
  return (
    <div>
      <HeaderSection />
      <br></br>
      <br></br>
      <OverviewSection />
      <ProfileSection />
    </div>
  );
}

export default App;
